INSERT INTO `pages` (`id`, `template`, `name`, `title`, `slug`, `content`, `extras`, `banner_type`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'home', 'Home page', 'Everything you need to drive engagement. All in one place. ', 'home', '<h2>Everything you need to drive engagement. All in one place.</h2>\r\n<h3>Why Westcon-Comstor Cloud and AWS</h3>\r\n<p>The Westcon-Comstor Cloud Practice helps customers capitalize on global IT cloud opportunities by enabling and inspiring their businesses to grow and thrive.&nbsp;In order to fulfill our promise, we have partnered with Amazon Web Services (AWS), a trusted cloud services vendor with more than a decade of cloud expertise.</p>', '{"short_description":"<p>This website is a great resource for Westcon-Comstor and AWS education, awareness and engagement. Below, you can find additional information about the sections on this site.<\\/p>"}', '', '2016-07-14 13:43:28', '2016-10-20 05:15:30', NULL),
(4, 'westcon_Comstor_AWS_Cloud_Portfolio', 'Portfolio', 'Portfolio Page', 'westcon-comstor-aws-cloud-prtfolio', '<h2>Everything you need to drive engagement. All in one place.</h2>\r\n<h3>Why Westcon-Comstor Cloud and AWS</h3>\r\n<p>The Westcon-Comstor Cloud Practice helps customers capitalize on global IT cloud opportunities by enabling and inspiring their businesses to grow and thrive.&nbsp;In order to fulfill our promise, we have partnered with Amazon Web Services (AWS), a trusted cloud services vendor with more than a decade of cloud expertise.</p>', '{"banner_title":"test","banner_description":"","banner_image":"assets\\/banner3.jpg","short_description":"<p>This website is a great resource for Westcon-Comstor and AWS education, awareness and engagement. Below, you can find additional information about the sections on this site.<\\/p>"}', '', '2016-10-04 19:06:41', '2016-10-21 03:48:20', NULL),
(6, 'engaging_End_Customers', 'Engaging End Customers', 'Engaging', 'engaging-end-customers', '<div class="row" style="box-sizing: border-box; margin: 0px -15px; padding: 0px; color: #333333; font-family: Lato, Arial, sans-serif; font-size: 14px; letter-spacing: -0.2px;">\r\n<div class="col-md-12 wc-details-con" style="box-sizing: border-box; margin: 0px; padding: 0px 15px; position: relative; min-height: 1px; float: left; width: 1170px;">\r\n<div class="col-md-6" style="box-sizing: border-box; margin: 0px; padding: 0px 15px; position: relative; min-height: 1px; float: left; width: 570px;">\r\n<ul class="details-ul" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; transition: all 0.3s ease-in;">\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/assets/MDLIVE-Activation-Poster-ENG.pdf" target="_blank">Activation-PDF-ENG</a></li>\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/assets/MDLIVE-Activation-Poster-SPA.pdf" target="_blank">Activation-PDF-SPA</a></li>\r\n</ul>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;">&nbsp;</p>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">What is it?</span>&nbsp;Large one-page, four-color overview poster.</p>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">How to use it:</span>&nbsp;Print and place in areas where employees congregate to promote awareness of MDLIVE and virtual care. Ideal locations are elevators, lunch room, break room, near the water cooler, and hallways.</p>\r\n</div>\r\n<div class="col-md-6" style="box-sizing: border-box; margin: 0px; padding: 0px 15px; position: relative; min-height: 1px; float: left; width: 570px;">\r\n<ul class="details-ul" style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; transition: all 0.3s ease-in;">\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/engaging" target="_blank">160&times;600-Generic-JPG-ENG</a></li>\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/engaging" target="_blank">720&times;90-Generic-JPG-ENG</a></li>\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/engaging" target="_blank">160&times;600-Generic-JPG-SPA</a></li>\r\n<li style="box-sizing: border-box; margin: 0px 0px 0px 12px; padding: 0px; transition: all 0.3s ease-in; list-style: square; color: #aa0000;"><a style="box-sizing: border-box; margin: 0px; padding: 0px; background: transparent; color: #aa0000; text-decoration: none; transition: all 0.3s ease 0s;" href="http://localhost:8000/engaging" target="_blank">720&times;90-Generic-JPG-SPA</a></li>\r\n</ul>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;">&nbsp;</p>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">What is it?</span>&nbsp;Digital banners encouraging activation.</p>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">How to use it:</span>&nbsp;Place banners on your Intranet site or in employee/member newsletters. Use banners in email blasts to your community of eligible members.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="row" style="box-sizing: border-box; margin: 0px -15px; padding: 0px; color: #333333; font-family: Lato, Arial, sans-serif; font-size: 14px; letter-spacing: -0.2px;">\r\n<div class="col-md-12" style="box-sizing: border-box; margin: 0px; padding: 0px 15px; position: relative; min-height: 1px; float: left; width: 1170px;">\r\n<div class="wc-widget" style="box-sizing: border-box; margin: 40px 0px 0px; padding: 25px; background: #edeeee; display: inline-block;">\r\n<h2 style="box-sizing: border-box; margin: 0px; padding: 0px; font-family: GothamBook-Regular; font-weight: 400; line-height: 1; color: #aa0000; font-size: 30px;">Video Presentations</h2>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">What is it?</span>&nbsp;Short overview videos available for download</p>\r\n<p class="itemdesc" style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">How to use it:</span>&nbsp;Place on intranet site or host videos and provide links to them in emails and promotions to employees/members. Videos are ideal for providing a quick, easy-to-understand overview, especially for new employees or those new to virtual care.</p>\r\n</div>\r\n</div>\r\n</div>', '{"banner_title":"","banner_description":"Process overviews for activating, onboarding and transacting with your customers","short_description":"<h4 style=\\"box-sizing: border-box; margin: 0px; padding: 0px; font-family: GothamBook-Regular; font-weight: 400; line-height: 1; color: #333333; font-size: 18px; letter-spacing: -0.2px; text-align: center;\\">Please find below documentation for activating and on-boarding your customers<\\/h4>","banner_image":"assets\\/banner.jpg"}', '', '2016-10-21 04:10:23', '2016-10-21 07:56:55', NULL),
(7, 'activition_On_Boarding_And_Support', 'Boarding And Support', 'Support', 'activition-on-boarding-and-support', '<h2 style="box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; font-family: GothamBook-Regular; font-weight: 400; line-height: 1; color: #333333; font-size: 30px; border-bottom: 1px solid #d7d7d7; letter-spacing: -0.2px;">AWS Support Documentation</h2>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 14px; color: #333333; font-family: Lato, Arial, sans-serif; letter-spacing: -0.2px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">What is it?</span>&nbsp;Complete campaigns focused on seasonal conditions to increase awareness and encourage utilization.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 14px; color: #333333; font-family: Lato, Arial, sans-serif; letter-spacing: -0.2px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold;">How to use it:</span>&nbsp;We suggest running one campaign per month and timing each campaign to coincide with the typical occurrence of these common ailments. In version 2.0 of the MDLIVE Marketing Hub there will be plenty of additional campaigns to choose and leverage so you can run one or two per month.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 14px; color: #333333; font-family: Lato, Arial, sans-serif; letter-spacing: -0.2px;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-weight: bold; outline: 0px;">How to build a campaign in 3 steps</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 14px; color: #333333; font-family: Lato, Arial, sans-serif; letter-spacing: -0.2px;">After adding your logo, phone number and web address to these materials just follow these 3 easy steps:</p>\r\n<ul style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; transition: al